import site1 from "../images/sites/site1.jpg";

function Portfolio(props) {
  return (
    <ul className="Portfolio-sites">
      {props.sites.map(site => (
        <li key={site}>
          <a href="http://localhost:8888/Beauty/" target="_blank">
            {site}
          </a>
        </li>
      ))}
      <style jsx>{`
        .Portfolio-sites {
          list-style-type: none;
          display: flex;
          flex-wrap: wrap;
          max-width: 900px;
          justify-content: center;
          margin: 60px auto 0px;
          padding: 40px;
          font-size: 1.5rem;
        }
        li {
          flex-basis: 33%;
          padding: 20px 0px;
        }

        li a {
          color: #000;
          text-decoration: none;
        }
      `}</style>
    </ul>
  );
}

Portfolio.defaultProps = {
  sites: [
    "Beauty Site",
    "Cosmetics Site",
    "Restaurant Site",
    "Sports Site",
    "Music Site",
    "Legal Site"
  ]
};

export default Portfolio;
